                        Cantidad de incritos:{this.cantInscritos}
                    </p>
                    <p>
                        Tutor del curos:{this.nombreTutor}
                    </p>
        </div>
  </div>

)


class Carrusel extends Component {
  componentDidMount() {
    Bootstrap.carousel();
  }

  render() {
    return (
        <main role="main">
          <MyCarousel />
        </main>
    );
  }
}

export default Carrusel;
